const root = document.querySelector("#root");
const h1 = document.createElement("h1");
h1.textContent = "Have I seen this movie?";
root.appendChild(h1);
const container = document.createElement("div");
container.id = "flex-container";
root.appendChild(container);

let fragment = document.createDocumentFragment();
const modal = document.querySelector("#myModal");
const span = document.querySelector(".close");
span.addEventListener("click", () => {
  modal.style.display = "none";
});

window.onclick = (e) => {
  if(e.target == modal) {
    modal.style.display = "none";
  }
}
let answerText = document.querySelector(".answer");

  database.forEach(movie => {
    const divElem = document.createElement("div");
    divElem.id = "movies";
    divElem.innerHTML = `<img src=${movie.image} />
    <p><strong>${movie.title}</strong></p> 
    <p>Rating: ${movie.rating}</p> 
    <button class="yes-button" onclick="modal.style.display='block'; ${movie.hasWatched} ? answerText.innerHTML = '<span>Your guess is correct!</span> <span>I have seen ${movie.title}.</span>' : answerText.innerHTML = '<span>Your guess is not correct!</span> <span>I have not seen ${movie.title}.</span>'">Yes</button> 
    <button class="no-button" onclick="modal.style.display='block'; ${movie.hasWatched} == false ? answerText.innerHTML = '<span>Your guess is correct!</span> <span>I have not seen ${movie.title}.</span>' : answerText.innerHTML = '<span>Your guess is not correct! I have seen ${movie.title}.</span>'">NO</button>`;
    container.appendChild(divElem);
  })

  


